components:
  schemas:
    ApproveInvoice:
      required:
      - approved
      type: object
      properties:
        approved:
          type: boolean
          description: If true, the Boss accepted the Invoice
      description: Every Invoice has to be accepted by the Boss.
    ApproverGroup:
      oneOf:
      - $ref: '#/components/schemas/accounting'
      - $ref: '#/components/schemas/management'
      - $ref: '#/components/schemas/sales'
    AssignApproverGroups:
      type: object
      properties:
        approverGroups:
          type: array
          items:
            $ref: '#/components/schemas/ApproverGroup'
    AssignedReviewer:
      required:
      - reviewer
      type: object
      properties:
        reviewer:
          type: string
    FileInOut:
      required:
      - fileName
      - content
      type: object
      properties:
        fileName:
          type: string
        content:
          type: string
          description: The content of the File as a Byte Array.
          format: binary
        mimeType:
          type: string
    InvoiceCategory:
      oneOf:
      - $ref: '#/components/schemas/Misc'
      - $ref: '#/components/schemas/Software License Costs'
      - $ref: '#/components/schemas/Travel Expenses'
    InvoiceReceipt:
      required:
      - creditor
      - amount
      - invoiceCategory
      - invoiceNumber
      - invoiceDocument
      type: object
      properties:
        creditor:
          type: string
        amount:
          type: number
          format: double
        invoiceCategory:
          $ref: '#/components/schemas/InvoiceCategory'
        invoiceNumber:
          type: string
        invoiceDocument:
          $ref: '#/components/schemas/FileInOut'
      description: Received Invoice that need approval.
    InvoiceReceiptCheck:
      required:
      - approved
      type: object
      properties:
        approved:
          type: boolean
          description: If true, the Boss accepted the Invoice
        clarified:
          type: boolean
          description: Flag that is set by the Reviewer (only set if there was a review).
    InvoiceReviewed:
      required:
      - clarified
      type: object
      properties:
        clarified:
          type: boolean
          description: Flag that is set by the Reviewer
    Misc:
      type: object
      description: There are three possible Categories
    PrepareBankTransfer:
      type: object
      description: Prepares the bank transfer for the invoice. Only readOnly fields
        from the Process.
    SelectApproverGroup:
      required:
      - amount
      - invoiceCategory
      type: object
      properties:
        amount:
          type: number
          format: double
        invoiceCategory:
          $ref: '#/components/schemas/InvoiceCategory'
    Software License Costs:
      type: object
      description: There are three possible Categories
    Travel Expenses:
      type: object
      description: There are three possible Categories
    accounting:
      type: object
      description: These Groups can approve the invoice.
    management:
      type: object
      description: These Groups can approve the invoice.
    sales:
      type: object
      description: These Groups can approve the invoice.
